//  Fluid width for inputs
(function($){

    $.fn.fluidInput = function (options) {

        return this.each(function () {

            var selector = $(this);

            options = $.extend({
                hiddentInputTest: 'hidden-input-test',
            }, options);

            var minWidth = selector.width();

            var hiddenTestElement = $('<span>', {class:options.hiddentInputTest})

            selector.after(hiddenTestElement);
            var InputNameTest = selector.next();

            selector.on('keyup',function(){

                var inputValue = $(this).val();
                if(inputValue == ''){
                    selector.width(minWidth);
                    return;
                }

                InputNameTest
                    .text(inputValue);

                var newWidth = InputNameTest.width();

                if(newWidth > minWidth){
                    selector.width(newWidth);
                }

            })

        })

    }

$('.fluid-input').fluidInput();
    // Fluid textarea
    $.fn.fluidTextarea = function (options) {

        return this.each(function () {

            var selector = $(this);

            options = $.extend({
                hiddentInputTest: 'hidden-input-test',
            }, options);

            var minHeight = selector.height();

            var hiddenTestElement = $('<span>', {class:options.hiddentInputTest})

            selector.after(hiddenTestElement);
            var InputNameTest = selector.next();

            selector.on('keyup',function(event){

                if(event.keyCode == 13){

                    selector.height(selector.height()+30);

                    if( selector.height()+30 < minHeight){
                        minHeight = minHeight + 30;
                    }

                }

                var inputValue = $(this).val();

                var nReplaced = inputValue.replace(/([^>])\n/g, '$1<br/>');
                if(inputValue == ''){
                    selector.height(minHeight);
                    return;
                }

                InputNameTest
                    .html(nReplaced);

                var newHeight = InputNameTest.height();

                if(newHeight > minHeight){
                    selector.height(newHeight+30);
                }

            })

        })

    }

    $('textarea').fluidTextarea();

})(jQuery);
//  Fluid width for inputs